import { Link } from 'react-router-dom';

const AuthModule = () => {
  return (
    <ul>
      <li>
        <Link to={'/login'}>Have an account</Link>
      </li>
      <li>
        <Link to={'/signin'}>Create an account</Link>
      </li>
      <li>
        <Link to={'/terms'}>Terms of use</Link>
      </li>
    </ul>
  );
};

export default AuthModule;
